// config/buttons.js

import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faAddressBook,
  faCenterCode,
  faCode,
  faArchive
} from "@fortawesome/free-solid-svg-icons";

const navButtons = [
  {
    label: "Home",
    path: "/index",
    icon: <FontAwesomeIcon icon={fasCenterCode} />
  },
  {
    label: "About Me",
    path: "/about",
    icon: <FontAwesomeIcon icon={fasCode} />
  },
  {
    label: "My Projects",
    path: "/project",
    icon: <FontAwesomeIcon icon={fasArchive} />
  },
  {
    label: "Contact",
    path: "/contact",
    icon: <FontAwesomeIcon icon={fasAddressBook} />
  }
];

export default navButtons;
